import { createSchema, addTranslations, setLanguageByName, tr } from 'react-hook-form-auto'

export default function GetDependenciaModel(ddlData) {
    
    const model = createSchema('DependenciaModel', {
        nombre: {
            type: 'string',
            required: true,
            maxLength: 255,
        },
        id_usuario_jefe: {
            type: 'select',
            options: ddlData['usuario'],
        },
        estado: {
            type: 'select',
            required: true,
            options: [
                { value: '1', label: 'Activo' },
                { value: '0', label: 'Inactivo' }
            ],
        }
    });

    return model;
}


setLanguageByName('es')
addTranslations({
    models: {
        DependenciaModel: {
            nombre: 'Nombre',
            id_usuario_jefe: {
                _field: 'Usuario jefe',
                _default: "Seleccione",
            },
            estado: {
                _field: 'Estado',
                _default: "Seleccione",
            },
        },
    },
})
